using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace leetcode.test
{
    [TestClass]
    public class ShortestPalindromeTest
    {
        [TestMethod]
        public void TestMethod1()
        {
            var str = ShortestPalindrome("aacecaaa");
            Assert.AreEqual("aaacecaaa", str);
        }
        [TestMethod]
        public void TestMethod2()
        {
            var str = ShortestPalindrome("abcd");
            Assert.AreEqual("dcbabcd", str);
        }
        [TestMethod]
        public void TestMethod3()
        {
            var str = ShortestPalindrome("");
            Assert.AreEqual("", str);
        }
        public string ShortestPalindrome(string s)
        {
            var i = 0;
            var j = s.Length - 1;
            var cont = s.Length;
            var aditional = string.Empty;
            var str = s;
            while (!IsPalindrome(str.Substring(i, cont)))
            {
                var array = str.ToCharArray();
                var c = array[j];
                while (array[--j] == c && array[i] != array[j])
                {
                    aditional += c;
                    i++;
                    cont--;
                }
                aditional += c;
                i++;
                cont--;
                str = aditional + s;
            }
            return str;
        }

        private bool IsPalindrome(string s)
        {
            var array = s.ToCharArray();
            for (var i = 0; i < array.Length / 2; i++)
            {
                if (array[i] != array[array.Length - i - 1])
                    return false;
            }
            return true;
        }
        public string ShortestPalindrome1(string s)
        {
            var i = 0;
            var j = s.Length - 1;
            var cont = s.Length;
            var aditional = string.Empty;
            var str = s;
            while (!IsPalindrome(str.Substring(i, cont)))
            {
                aditional += str.ToCharArray()[j];
                i++;
                cont--;
                str = aditional + s;
            }
            return str;
        }
    }
}
